    {/* <div className='main-container'> */}
      <Header />
      <Main/>
      <Contacts/>
      <Gallery/>
      <Portfolio/>
      <Footer />

      <RouterProvider router={router} />

    {/* </div> */}
  </React.StrictMode>
);
